    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Seal Beach NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Seal Beach NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, alternatives,
    environmental consequences, and strategies for implementation. Key planning issues
    include: habitat management, threatened and endangered species, recreation, research,
    operation, and Refuge boundary expansion.",nt"license_title": "License Not
